Param (
[string]$installPath
)
Import-Module Microsoft.PowerShell.Utility
Import-Module Microsoft.PowerShell.Management
Import-Module Microsoft.PowerShell.Security
if ( $installPath ) { Write-Host "Install CDAF to $installPath ..." } else { Write-Host "Install CDAF to ./automation ..." }
$Base64 = "

"
if ( Test-Path "./automation" ) { Remove-Item -Recurse -Force "./automation" }
if ( Test-Path WU-CDM.zip ) { Remove-Item -Force WU-CDM.zip }
$Content = [System.Convert]::FromBase64String($Base64)
Set-Content -Path "WU-CDM.zip" -Value $Content -Encoding Byte
Add-Type -AssemblyName System.IO.Compression.FileSystem
[System.IO.Compression.ZipFile]::ExtractToDirectory("$PWD\WU-CDM.zip", "$PWD")
if ( $installPath ) { if ( Test-Path $installPath ) { Remove-Item -Recurse -Force $installPath } ; Move-Item ./automation $installPath } 
Get-Content ./automation/CDAF.windows | FINDSTR productVersion
